import './css/App.css';


const App = () => {

  const myBoolean = true;

  const test = test => test*3;

  const onClickHandler = (testvar) => {
    alert(testvar);
  }

  return (
    <>

      <div className="">App.js</div>
      <button onClick={onClickHandler}>click</button>
      { myBoolean ? <div>Bonjour</div> : <div>Bye</div> }
      { [<p>45</p>, <div>test</div>, <div>Bonjour</div>] }
      { test(1) }

    </>
  )


}


export default App;
